    false,nt"url": null,nt"notes": "This narrative report for Horicon National
    Wildlife Refuge outlines Refuge accomplishments from May through August of 1956.
    The report begins by summarizing the weather conditions and water conditions during
    this period. Wildlife- including migratory birds, upland game birds, big game animals,
    furbearers, predators, rodents, and raptors- is also covered. The Refuge development
    and maintenance section discusses physical development, plantings, collections and
    receipts. Resource management is outlined; topics include grazing. A progress report
    on field investigations and applied research is also provided. The public relations
    section of the report describes recreational uses, Refuge visitors, Refuge participation,
    and fishing. N-R forms and photographs are attached.",nt"license_title": "License
